import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import StartScreen from './components/StartScreen';
import Quiz from './components/Quiz';
import hcbgImage from "/Users/anjaliagrawal/Desktop/ons/public/images/b1.png";
import './App.css';

function App() {
  return (
    <Router>

      <div className="App" style={{backgroundImage: `url(${hcbgImage})`,backgroundSize: "cover",height: "100vh",color: "#f5f5f5"}}>
        <Switch>
          <Route exact path="/" component={StartScreen} />
          <Route path="/Quiz" component={Quiz} />
        </Switch>
      </div>

    </Router>
  );
}

export default App;
